    giorno1 += "<div class=\"elementor-widget-container\">";
    giorno1 += "<p class=\"p1\">È davvero possibile che le anime si rincorrano nel tempo scegliendo di sperimentare la vita insieme, in forme e aspetti diversi? Il Dr. Weiss sostiene di sì, che l’amore non conosce tempo e in qualche modo ci si rincontri sempre.<\/p><p class=\"p1\">Ti è mai capitato di incrociare lo sguardo di uno sconosciuto e riconoscere in lui una familiarità? Il Dr. Weiss ha raccolto tantissime storie di persone che hanno incontrato la loro anima gemella. In questa Masterclass gratuita potrai scoprire come riconoscere gli indizi che ti conducono all’Anima Gemella nella tua vita.<\/p> <\/div>";
