    giorno1 += "<a class=\"elementor-accordion-title\" tabindex=\"0\">#1 Come posso avere tutti questi contenuti per sempre?<\/a>";
    giorno1 += "<\/div>";
    giorno1 += "<div id=\"elementor-tab-content-1341\" class=\"elementor-tab-content elementor-clearfix elementor-active\" data-tab=\"1\" role=\"region\" aria-labelledby=\"elementor-tab-title-1341\" style=\"display: block;\"><p class=\"p1\"><span style=\"font-family: 'PT Sans', sans-serif; font-size: 18px; font-style: normal; font-weight: 200;\">Acquista il corso in offerta entro mercoledì 8 novembre e ricevi subito tutti i contenuti della Masterclass per sempre, anche il certificato, le meditazioni e gli audio. Scopri tutti i fantastici bonus di valore che ricevi con <\/span><a style=\"font-family: 'PT Sans', sans-serif; font-size: 18px; font-style: normal; font-weight: 200; color: #213768;\" href=\"https:\/\/brianweiss.it\/corsoavanzato\/\" target=\"blank\"><span style=\"font-size: 18px; font-weight: bold;\">l’acquisto del corso entro mercoledì 8 novembre &gt;<\/span><\/a><\/p><\/div>";
    giorno1 += "<\/div>";
    giorno1 += "<div class=\"elementor-accordion-item\">";
    giorno1 += "<div id=\"elementor-tab-title-1342\" class=\"elementor-tab-title\" data-tab=\"2\" role=\"button\" aria-controls=\"elementor-tab-content-1342\" aria-expanded=\"false\">";
    giorno1 += "<span class=\"elementor-accordion-icon elementor-accordion-icon-left\" aria-hidden=\"true\">";
    giorno1 += "<span class=\"elementor-accordion-icon-closed\"><i class=\"far fa-question-circle\"><\/i><\/span>";
