    giorno1 += "<\/span>";
    giorno1 += "<a class=\"elementor-accordion-title\" tabindex=\"0\">#2 Fino a quando rimarranno disponibili i contenuti?<\/a>";
    giorno1 += "<\/div>";
    giorno1 += "<div id=\"elementor-tab-content-1342\" class=\"elementor-tab-content elementor-clearfix\" data-tab=\"2\" role=\"region\" aria-labelledby=\"elementor-tab-title-1342\"><p class=\"p1\">I contenuti gratuiti di ogni giorno rimarranno disponibili in visione illimitata fino alle ore 10:00 del giorno successivo, così potrai vederli negli orari per te più comodi.<\/p><\/div>";
    giorno1 += "<\/div>";
    giorno1 += "<div class=\"elementor-accordion-item\">";
