    giorno1 += "<a class=\"elementor-accordion-title\" tabindex=\"0\">#3 In quale orario riceverò la email con il link di visione?<\/a>";
    giorno1 += "<\/div>";
    giorno1 += "<div id=\"elementor-tab-content-1343\" class=\"elementor-tab-content elementor-clearfix\" data-tab=\"3\" role=\"region\" aria-labelledby=\"elementor-tab-title-1343\"><p class=\"p1\"><span style=\"font-family: 'PT Sans', sans-serif; font-size: 18px; font-style: normal; font-weight: 200;\">Ogni mattina, circa alle ore 6:30, riceverai la email con i link riservati di accesso. Se non dovessi riceverla ti basterà accedere nuovamente al <\/span><a style=\"font-family: 'PT Sans', sans-serif; font-size: 18px; font-style: normal; font-weight: 700; color: #213768;\" href=\"https:\/\/brianweiss.it\" target=\"blank\">link<\/a><span style=\"font-family: 'PT Sans', sans-serif; font-size: 18px; font-style: normal; font-weight: 200;\"> ed inserire il tuo nome e il tuo indirizzo email; la pagina ti porterà ai contenuti del giorno.<\/span><\/p><\/div>";
    giorno1 += "<\/div>";
    giorno1 += "<div class=\"elementor-accordion-item\">";
