    intro += "<div class=\"elementor-element elementor-element-e0179c8 elementor-widget elementor-widget-heading\" data-id=\"e0179c8\" data-element_type=\"widget\" data-widget_type=\"heading.default\">";
    intro += "<div class=\"elementor-widget-container\">";
    intro += "<h2 class=\"elementor-heading-title elementor-size-default\">Le Carte delle Vite Passate<\/h2> <\/div>";
    intro += "<\/div>";
    intro += "<div class=\"elementor-element elementor-element-d88d102 elementor-widget elementor-widget-heading\" data-id=\"d88d102\" data-element_type=\"widget\" data-widget_type=\"heading.default\">";
    intro += "<div class=\"elementor-widget-container\">";
    intro += "<h2 class=\"elementor-heading-title elementor-size-default\">Gira una carta (cliccaci sopra) e scopri il messaggio che giunge a te dal passato<\/h2> <\/div>";
    intro += "<\/div>";
    intro += "<div class=\"elementor-element elementor-element-79683a3 elementor-widget elementor-widget-heading\" data-id=\"79683a3\" data-element_type=\"widget\" data-widget_type=\"heading.default\">";
    intro += "<div class=\"elementor-widget-container\">";
    intro += "<h2 class=\"elementor-heading-title elementor-size-default\">Scopri in che modo il passato può migliorare il tuo presente<\/h2> <\/div>";
    intro += "<\/div>";
    intro += "<div class=\"elementor-element elementor-element-7bebc5b elementor-widget elementor-widget-shortcode\" data-id=\"7bebc5b\" data-element_type=\"widget\" data-widget_type=\"shortcode.default\">";
    intro += "<div class=\"elementor-widget-container\">";
    intro += "<center><div class=\"scene2 scene2--card1\"><div class=\"card1\"><div class=\"card1__face card1__face--front\"><img alt=\"retro\" src=\"..\/GiocoCarte\/carte-vite-passate\/carte_vite_passate_retro.jpg\"><\/div><div class=\"card1__face card1__face--back\"><img alt=\"fronte\" src=\"..\/GiocoCarte\/carte-vite-passate\/carte_vite_passate_35.jpg\"><\/div><\/div><\/div><\/center><center><div class=\"desc1\"><p style=\"line-height:1.2\">Questa carta indica che hai trascorso del tempo in prigione o in schiavitù. Sei stato privato dei tuoi diritti, così come della tua dignità e libertà. Adesso sei libero, ma potresti ancora covare delle paure legate a quella esistenza. Per esempio, potresti soffrire di claustrofobia quando ti trovi in spazi ristretti o sugli aerei. Oppure potresti aver sviluppato una forma della sindrome di Stoccolma, per cui provi empatia verso chi ti maltratta.";
    intro += "D’altra parte, le esperienze passate possono anche renderti estremamente compassionevole nei confronti di chi soffre. Potresti votarti alla difesa degli oppressi e a portare più amore e giustizia in questo mondo.";
    intro += "Per guarire da ogni paura residua proveniente da quella esistenza, ricorda i dettagli della tua vita passata così da sciogliere le catene e liberarti dai sintomi.";
    intro += "Convoglia le tue inclinazioni e i tuoi sentimenti altruistici nell’aiutare la società. Gli atti di bontà e di compassione guariscono sia l’individuo che il mondo.<\/p><\/div><\/center><br><center><div><p class=\"link1\">Vuoi un altro messaggio? Clicca qui per mescolare le carte&gt;<\/p><p class=\"linksotto\">Poi clicca di nuovo sul dorso della carta e scopri il nuovo messaggio.<\/p><\/div><\/center> <div class=\"elementor-shortcode\"><\/div>";
    intro += "<\/div>";
    intro += "<\/div>";
    intro += "<div class=\"elementor-element elementor-element-693ef0d elementor-widget elementor-widget-text-editor\" data-id=\"693ef0d\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">";
    intro += "<div class=\"elementor-widget-container\">";
    intro += "<p>Ti consigliamo di provare l’applicazione utilizzando Google Chrome.<\/p> <\/div>";
