    intro += "<blockquote class=\"elementor-blockquote\">";
    intro += "<p class=\"elementor-blockquote__content\">";
    intro += "\"Se comprendi la tua vera natura e il tuo vero scopo, <br>la tua vita cambierà per sempre, <br>e allora potrai iniziare a cambiare il mondo.\" <\/p>";
