    intro += "<div class=\"elementor-element elementor-element-e73b408 elementor-widget elementor-widget-heading\" data-id=\"e73b408\" data-element_type=\"widget\" data-widget_type=\"heading.default\">";
    intro += "<div class=\"elementor-widget-container\">";
    intro += "<h2 class=\"elementor-heading-title elementor-size-default\">Vuoi vivere l’esperienza della Regressione alle Vite passate in un corso esclusivo e intenso con il Dr. Weiss?<\/h2> <\/div>";
    intro += "<\/div>";
    intro += "<div class=\"elementor-element elementor-element-ab7e5aa elementor-widget elementor-widget-text-editor\" data-id=\"ab7e5aa\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">";
    intro += "<div class=\"elementor-widget-container\">";
    intro += "<p class=\"p1\"><span class=\"s1\">Questa è l’unica versione del corso avanzato online disponibile in tutto il mondo. È una opportunità incredibile per scoprire e vivere l’esperienza delle vite passate con la guida del massimo esperto, il Dr. Brian Weiss, psichiatra e psicoterapeuta. Il Dr. Weiss è l’unico insegnante del suo metodo.&nbsp;<\/span><\/p><p class=\"p1\"><span class=\"s1\">Da anni non insegna più i corsi dal vivo. Questo corso online ti consentirà di seguire gli insegnamenti del Dr. Weiss come se fossi seduto in prima fila con la visuale migliore, rimanendo nel luogo più confortevole: la tua casa. Finalmente avrai accesso alla registrazione completa di “Molte Vite, Molti Maestri”, il corso che il Dr. Weiss ha tenuto per l’ultima volta live in tre giorni sul lago di Garda.&nbsp;<\/span><\/p><p class=\"p1\"><span class=\"s1\">Ricevilo in lingua originale in inglese e con la traduzione in italiano!<\/span><\/p> <\/div>";
    intro += "<\/div>";
