    intro += "<\/div>";
    intro += "<div class=\"elementor-element elementor-element-e0fb427 elementor-widget elementor-widget-text-editor\" data-id=\"e0fb427\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">";
    intro += "<div class=\"elementor-widget-container\">";
    intro += "<p class=\"p1\"><span class=\"s1\">Siamo tutti connessi, ma ognuno di noi ha delle anime con cui è più in sintonia, come onde che viaggiano sulla stessa frequenza.&nbsp;<\/span><\/p><p class=\"p1\"><span class=\"s1\">Sono quelle che chiamiamo Anime Gemelle, ossia anime che, per un’affinità elettiva o per unione d’intenti, condividono con noi il percorso di crescita spirituale attraverso le varie vite e con cui siamo destinati a rincontrarci di volta in volta.&nbsp;<\/span><\/p><p class=\"p1\"><span class=\"s1\">Scopri la tua anima gemella con la guida esperta del Dr. Weiss.<\/span><\/p> <\/div>";
