    intro += "<div class=\"elementor-element elementor-element-a8065b5 elementor-blockquote--skin-clean elementor-blockquote--align-center elementor-blockquote--button-color-official elementor-widget elementor-widget-blockquote\" data-id=\"a8065b5\" data-element_type=\"widget\" data-widget_type=\"blockquote.default\">";
    intro += "<div class=\"elementor-widget-container\">";
    intro += "<blockquote class=\"elementor-blockquote\">";
    intro += "<p class=\"elementor-blockquote__content\">";
    intro += "\"Sii perseverante, paziente e aperto:<br>";
    intro += "il viaggio è importante quanto la destinazione.” <\/p>";
