    intro += "<div class=\"elementor-widget-wrap elementor-element-populated\">";
    intro += "<div class=\"elementor-element elementor-element-14ce76a elementor-widget elementor-widget-heading\" data-id=\"14ce76a\" data-element_type=\"widget\" data-widget_type=\"heading.default\">";
    intro += "<div class=\"elementor-widget-container\">";
    intro += "<h2 class=\"elementor-heading-title elementor-size-default\">Un atto di grande generosità<\/h2> <\/div>";
    intro += "<\/div>";
    intro += "<div class=\"elementor-element elementor-element-379eeda elementor-widget elementor-widget-text-editor\" data-id=\"379eeda\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">";
    intro += "<div class=\"elementor-widget-container\">";
    intro += "<p class=\"p1\">Hai un fastidio alla schiena che ti tormenta da mesi e non riesci a liberartene neanche con i farmaci. <b>Hai consultato medici, fatto analisi, ma il dolore persiste e non ti abbandona mai.<\/b> Oppure soffri di attacchi di panico, sei terrorizzato dalle altezze o hai una paura irrazionale dell’acqua.<\/p><p class=\"p1\"><b>Potrebbero essere disagi legati a esperienze di vite precedenti<\/b>, come è accaduto a Catherine, la giovane donna di cui il Dr. Brian Weiss racconta nei corsi online <i>Molte Vite, Molti Maestri<\/i>. Catherine, quando si presentò per la prima volta nello studio del dottor Weiss, era afflitta da molteplici fobie che rendevano la sua quotidianità complicata. Aveva attacchi di panico, disturbi del sonno, paura di soffocare. Tutti questi disagi la facevano vivere in un continuo stato d’ansia.<\/p><p class=\"p1\">Dopo molti mesi, grazie alle sedute di regressione alle vite passate, <b>i disturbi di Catherine sparirono e il Dr. Weiss decise di portare alla luce questa sua straordinaria esperienza<\/b>, perché divenisse un motivo di ricerca e una fonte di aiuto. Fu un atto di grande coraggio e generosità, in quanto si trattava di opporsi in qualche modo alla comunità scientifica tradizionale.<\/p><p class=\"p1\">Da allora <b>il dottor Weiss ha applicato l’ipnosi regressiva alle vite passate su migliaia di persone,<\/b> ognuna delle quali ne ha ricavato enormi benefici, sia a livello fisico che spirituale.<\/p> <\/div>";
    intro += "<\/div>";
    intro += "<\/div>";
    intro += "<\/div>";
    intro += "<\/div>";
