    intro += "<div id=\"elementor-tab-content-7181\" class=\"elementor-tab-content elementor-clearfix elementor-active\" data-tab=\"1\" role=\"region\" aria-labelledby=\"elementor-tab-title-7181\" style=\"display: block;\"><p class=\"p1\"><span style=\"font-family: 'PT Sans', sans-serif; font-size: 18px; font-style: normal; font-weight: 200;\">Acquista il corso in offerta entro mercoledì 8 novembre e ricevi subito tutti i contenuti della Masterclass per sempre, anche il certificato, le meditazioni e gli audio. Scopri tutti i fantastici bonus di valore che ricevi con <\/span><a style=\"font-family: 'PT Sans', sans-serif; font-size: 18px; font-style: normal; font-weight: 200; color: #213768;\" href=\"https:\/\/brianweiss.it\/corsoavanzato\/\" target=\"blank\"><span style=\"font-size: 18px; font-weight: bold;\">l’acquisto del corso entro mercoledì 8 novembre &gt;<\/span><\/a><\/p><\/div>";
