    intro += "<div id=\"elementor-tab-content-7182\" class=\"elementor-tab-content elementor-clearfix\" data-tab=\"2\" role=\"region\" aria-labelledby=\"elementor-tab-title-7182\"><p class=\"p1\">I contenuti gratuiti di ogni giorno rimarranno disponibili in visione illimitata fino alle ore 10:00 del giorno successivo, così potrai vederli negli orari per te più comodi.<\/p><\/div>";
